SET DEFINE OFF


ALTER SESSION SET NLS_DATE_FORMAT='DD/MM/YYYY';
SET LINESIZE 120
SET PAGESIZE 100
SET DEFINE OFF

DROP TABLE Supply;

CREATE TABLE Supply(
   supply_id    VARCHAR(7)  NOT NULL,
   date_receive DATE        NOT NULL,
   supply_title VARCHAR(64) NOT NULL,
   supplier_id  VARCHAR(7)  NOT NULL,
   quantity     INTEGER     NOT NULL,
   price        INTEGER     NOT NULL,
   employee_id  VARCHAR(8)  NOT NULL,
   category     VARCHAR(27) NOT NULL,
   PRIMARY KEY(supply_id, date_receive),
   CONSTRAINT fk_supply_supplier FOREIGN KEY(supplier_id) REFERENCES Supplier(supplier_id),
   CONSTRAINT fk_supply_employee FOREIGN KEY(employee_id) REFERENCES Employee(employee_id),
   CONSTRAINT supply_chk_id    CHECK (REGEXP_LIKE(supply_id, '^SUP\d{4}$')),
   CONSTRAINT supply_chk_price CHECK (price>0)
);


SET DEFINE ON
select count(*) as TotalSupplyRecords from Supply;